Cast: Alberto Rey, Alex Mantegna, Asian Shan, Chris Taylor, David Perry, Frank Gunn, Loureen Kiss, Lynn Stone, Mike Foster, Natasha *, Nicolette, Nikki Anderson, Nikki Montana, Philippe Dean

Description: The Earth has been almost completely destroyed by nuclear war, human life itself is under serious threat, since many of the male survivors have been rendered impotent by the radiation. In a dilapidated temple lives a mysterious creature from the past called Virtualia who offers humans the chance to enjoy ecstatic erotic adventures thanks to a digital network. Virtualia knows nothing about her history and has frequent flashbacks which cause her much personal suffering. In the course of the film, we discover that Virtualia is not human, but a biological android. This compelling story is full of surprises and compulsive sex scenes, exotic location reconstructed in studios, with external scenes shot in Spain including the remains of an abandoned city and desert scenes.

